import React from 'react';
import TodoItem from './TodoItem';
import './TodoList.css';


const TodoList = ({ todos, onDelete }) => {
  return (
    <div className="container">
      <ul>
      {todos.map((todo) => (
        <TodoItem key={todo.id} todo={todo} onDelete={onDelete} />
      ))}
    </ul>
    </div>
  );
};

export default TodoList;
